// Date Time Formatting

import java.time.LocalDateTime
import java.time.LocalDate
import java.time.LocalTime
import java.time.format.DateTimeFormatter

val str = "2019-08-05 07:00:14"

val dateTime = LocalDateTime.parse(str, DateTimeFormatter.ofPattern("yyyy-MM-dd HH:mm:ss") )
val dateFromDateTime = dateTime.toLocalDate();
val timeFromDateTime = dateTime.toLocalTime();

val refTime = LocalTime.parse("08:00:00", DateTimeFormatter.ofPattern("HH:mm:ss"))
val choice = timeFromDateTime.isAfter(refTime.plusMinutes(480))



// plusMinutes, minusMinutes, isBefore, isAfter
